export async function getUser(authorization, userOperations, urlFormatter, userLink) {
    if (!userLink)
        return undefined;
    const { iModelId, userId } = urlFormatter.parseUserUrl(userLink);
    return userOperations.getSingle({
        authorization,
        iModelId,
        userId
    });
}
